import axios from 'axios';

const API_BASE_URL = 'https://frontend-take-home-service.fetch.com';

// Function to handle user login
export const login = async (name, email) => {
  try {
    const response = await axios.post(`${API_BASE_URL}/auth/login`, { name, email }, {
      withCredentials: true
    });
    return response.data;
  } catch (error) {
    console.error('Login API error:', error);
    throw error;
  }
};

// Function to search dogs with filters
export const searchDogs = async (filters) => {
  try {
    const response = await axios.get(`${API_BASE_URL}/dogs/search`, {
      params: filters,
      withCredentials: true
    });
    return response.data; // Adjust based on actual API response structure
  } catch (error) {
    console.error('Search API error:', error);
    throw error;
  }
};
